class Acending  extends Component{
    render(){
       const contenarray = this.props
        return( 
        <span id="ascending" className="ascending" onClick={contenarray.sort( function (a , b ){return b.peples - a.peples;})}> ترتيب تصاعدي </span>
        )
    }
    }
    export default Acending
